INSERT INTO `cms_company_profile` (`company_id`, `company_title`, `company_content`, `insert_user_id`, `insert_timestamp`, `update_user_id`, `update_timestamp`) VALUES
(1, 'Johnson Corporation', '<p>Business Information</p><ul><li>Business Name:&nbspJohnson Corporation</li><li>Business Address:&nbsp153 James Street, Miami,&nbspUSA</li><li>Email:&nbspInfo@Johncorp.com</li><li>Tel:&nbsp555-777-9999</li></ul><p>General Business Activities&nbspJohnson Corporation has been established as a real estate company in North and South America. Our traditional business model is based on the accomplishment of properties in the real estate markets in America. Based on the decision of the company to diversify our properties we have now established this corporation in Toronto. The revenues of our company are expected to be nearly US$50,000 per month depending on the variables that are factored in with investments in the real estate industry. There is a great need for certified or official bank checks in the future to deal with some real estate transactions. In addition to real estate investments, the company has invested portions of its assets in the purchase and sale of securities such as stocks and bonds as well as Forex trading on global markets.Company Strategy</p><ul><li>PurposeTo be a leader in the real estate industry by providing enhanced services, relationship and profitability.</li><li>VisionTo provide quality services that exceeds the expectations of our esteemed customers.</li><li>Mission statementTo build long term relationships with our customers and clients and provide exceptional customer services by pursuing business through innovation and advanced technology.</li><li>Core values&bull We believe in treating our customers with respect and faith&bull We grow through creativity, invention and innovation.&bull We integrate honesty, integrity and business ethics into all aspects of our business functioning</li><li>Goals&bull Regional expansion in the field of property management and develop a strong base of key customers.&bull Increase the assets and investments of the company to support the development of services.&bull To build good reputation in the field of real estate and property management and become a key player in the industry.</li></ul><p>Scope of WorkJohnson Corporation conducts real estate marketing as well as real estate consulting. The company undertakes all maintenance duties for real estate facilities and organizations and conducts all the security and surveillance for the properties.Financial Considerations&nbspThe company expects to reach the desired profits in the first year and does not anticipate serious cash flow problems. We believe that the average profitability per month for the first 3 years will be sufficient. However, we have current borrowing from the Bank of America to be paid off in 3 years. Most of the company&rsquos liabilities come from management investment.Expected Activities of General Bank Account&nbspInitial Deposit of US$1000 by Bank of Toronto Official check was made. Then wire funds of nearly US$300,000 from securities account were made. To prove the origin of funds, account documentation will be provided.Required Banking Services include savings account, checking account, online banking, and secured credit card and debit card.</p><div>&nbsp</div>', 1, '2016-01-12 13:27:35', 1, '2016-01-12 13:39:10');
