INSERT INTO `cms_news` (`news_id`, `news_title`, `news_content`, `news_snippet`, `news_photo`, `news_photo_origin`, `news_photo_path`, `news_photo_type`, `news_photo_size`, `news_status`, `newscat_id`, `insert_user_id`, `insert_timestamp`, `update_user_id`, `update_timestamp`) VALUES
(4, 'Gamatechno, Dari Jogja untuk Indonesia, menuju Dunia', '<h2>Gamatechno, Dari Jogja untuk Indonesia, menuju Dunia</h2>\r\n<p>Gamatechno adalah perusahaan yang memiliki fokus pada pengembangan produk dan solusi teknologi informasi untuk segmen perguruan tinggi, lembaga pemerintah, perusahaan penyedia jasa transportasi dan logistik, serta industri lifestyle&nbsp</p>\r\n<p>Sebagai perusahaan yang bergerak di bidang penyedia solusi teknologi informasi, PT Gamatechno Indonesia (Gamatechno) resmi berdiri pada tanggal 4 Januari 2005 dan berkantor pusat di Yogyakarta. Guna meningkatkan layanan kepada lebih dari 240 klien di seluruh Indonesia yang tersebar dari Banda Aceh hingga Papua, pada tahun 2013 Gamatechno membuka kantor cabang di Jakarta.</p>\r\n<p>Seiring dengan perkembangan perusahaan, saat ini Gamatechno memiliki fokus pada pengembangan produk dan solusi teknologi informasi untuk segmen perguruan tinggi, lembaga pemerintah, perusahaan penyedia jasa transportasi dan logistik, serta industri lifestyle. Layanan yang berfokus pada 4 segmen utama tersebut selanjutnya didefinisikan sebagai gtSmartCity Solution, yaitu solusi berbasis sistem dan teknologi informasi guna mewujudkan sebuah kota cerdas dengan ciri less paper, less time, less cash dan less complexity untuk meningkatkan tatanan hidup masyarakat.</p>\r\n<p>Untuk segmen perguruan tinggi, produk unggulan Gamatechno adalah gtCampus Suite yaitu sistem informasi terintegrasi untuk perguruan tinggi yang terdiri atas berbagai software modular yang dirancang sesuai dengan proses bisnis perguruan tinggi mulai dari pengelolaan penerimaan calon mahasiswa, pengelolaan perkuliahan mahasiswa hingga lulus, pengelolaan aset kampus yang meliputi aset sumber daya manusia, keuangan dan aset barang, perpustakaan, penelitian dan beasiswa hingga dashboard system untuk pimpinan kampus.<br />Untuk segmen lembaga pemerintah, Gamatechno memiliki beberapa produk unggulan, diantaranya adalah gtPerizinan (sistem pengelolaan pelayanan perizinan terpadu), gtAspirasi (sistem pengelolaan aspirasi masyarakat), serta aplikasi gtGroupware (sistem kolaborasi dan arsip perkantoran). Selain produk-produk tersebut, Gamatechno juga melayani pengembangan portal website lembaga dengan konsep citizen centric, serta pengembangan berbagai aplikasi berbasis web lainnya sesuai dengan kebutuhan lembaga.</p>\r\n<p>Untuk segmen transportasi dan logistik, Gamatechno mengembangkan beberapa produk unggulan bagi perusahaan atau organisasi yang bergerak dibidang layanan transportasi dan logistik, yaitu gtFleets (sistem informasi pengelolaan armada), gtSmartTicket System (sistem tiket elektronik berbasis smartcard), serta aplikasi mTransport (aplikasi mobile untuk informasi dan layanan transportasi publik).<br />Pada segmen lifestyle, Gamatechno mengembangkan produk-produk aplikasi back-end dan front-end untuk beberapa sub industri diantaranya taman hiburan dan wisata, pusat belanja dan entertainment, microfinance, dan industri kesehatan. Beberapa portofolio produk untuk segmen lifestyle ini antara lain eoviz.com (small &amp medium enterprises resource planning system on cloud), mEvent (aplikasi mobile informasi event), serta mCatalog (aplikasi mobile informasi katalog produk).</p>\r\n<p>Selain pengembangan produk aplikasi berbasis web, mobile, smartcard dan beberapa teknologi terkini lainnya yang dikemas dalam gtSmartCity Solution, Gamatechno juga menyediakan jasa konsultasi IT, audit IT, training IT, serta layanan maintenance sistem dan agregasi konten digital.</p>\r\n<p>Sebagai perusahaan yang berbasis perguruan tinggi, Gamatechno memiliki keunggulan kompetitif yang tidak dimiliki perusahaan lain, yaitu sumber daya dan aset riset yang dimiliki Universitas Gadjah Mada sebagai dasar pengembangan dan inovasi produk serta layanan Gamatechno agar tercipta solusi yang tepat guna bagi masyarakat. Dan untuk melengkapi layanan total kepada pelanggan dan mitra, saat ini Gamatechno telah memiliki anak perusahaan yaitu PT Aino Indonesia yang bergerak dibidang teknologi smartcard, RFId, dan Mobile NFC.</p>\r\n<h3>Legalitas</h3>\r\n<dl class="dl-horizontal"><dt>Nama</dt><dd>&nbspPT Gamatechno Indonesia&nbsp</dd><dt>Alamat</dt><dd>Jalan Cik Di Tiro no. 34, Yogyakarta 55223, Indonesia</dd><dt>Bidang Usaha</dt><dd>Teknologi Informasi dan Komunikasi termasuk pengembangan perangkat lunak, perangkat keras, konsultasi, dan pelatihan di bidang TI</dd><dt>No.Telepon</dt><dd>+62-274-566161</dd><dt>No.Faximile</dt><dd>+62-274-566160</dd><dt>No.NPWP</dt><dd>02.369.197.5-541.000</dd><dt>Akta Pendirian</dt><dd>No. 1/Tgl 04-01-2005, Notaris Sumendro SH</dd><dt>Pengesahan</dt><dd>No. C-08796 HT.01.01.TH.2005</dd><dt>HO</dt><dd>No. 503-0337/1234.GK/2005, Jasa TI dan Komunikasi</dd><dt>SIUP</dt><dd>15/12-05/PB/V/2005, Perdagangan Barang dan Jasa</dd><dt>TDP</dt><dd>120517201161</dd><dt>NPWP</dt><dd>02.369.197.5.541.000</dd><dt>INKINDO</dt><dd>A001 3471-1-120599, Bidang Telematika</dd><dt>Email&nbsp</dt><dd>info @ gamatechno.com</dd></dl>', 'Gamatechno adalah perusahaan yang memiliki fokus pada pengembangan produk dan solusi teknologi informasi untuk segmen perguruan tinggi, lembaga pemerintah, perusahaan penyedia jasa transportasi dan logistik, serta industri lifestyle', '9080d417319ad1b07acb39b438e2b35d.jpg', '4a9f1741-d544-435a-80b2-d510fe27d92c_169.jpg', 'files/cms/', 'jpg', 36537, 1, NULL, 1, '2016-01-14 10:31:09', 5, '2016-09-19 01:12:33');
INSERT INTO `cms_privacy_policy` (`policy_id`, `policy_name`, `policy_info`, `insert_user_id`, `insert_timestamp`, `update_user_id`, `update_timestamp`) VALUES
(1, 'Hangout Privacy Policy', '<p>If you require any more information or have any questions about our privacy policy, please feel free to contact us by email at&nbsp<a href="mailto:privacy@YourSite.com">Privacy</a>.</p>\r\n<p>At www.YourSite.com we consider the privacy of our visitors to be extremely important. This privacy policy document describes in detail the types of personal information is collected and recorded by www.YourSite.com and how we use it.</p>\r\n<p><strong>Log Files</strong><br />Like many other Web sites, www.YourSite.com makes use of log files. These files merely logs visitors to the site - usually a standard procedure for hosting companies and a part of hosting services''s analytics. The information inside the log files includes internet protocol (IP) addresses, browser type, Internet Service Provider (ISP), date/time stamp, referring/exit pages, and possibly the number of clicks. This information is used to analyze trends, administer the site, track user''s movement around the site, and gather demographic information. IP addresses, and other such information are not linked to any information that is personally identifiable.</p>\r\n<p><strong>Cookies and Web Beacons</strong><br />www.YourSite.com uses cookies to store information about visitors'' preferences, to record user-specific information on which pages the site visitor accesses or visits, and to personalize or customize our web page content based upon visitors'' browser type or other information that the visitor sends via their browser.</p>\r\n<p><strong>DoubleClick DART Cookie</strong></p>\r\n<p>&amprarr Google, as a third party vendor, uses cookies to serve ads on www.YourSite.com.<br />&amprarr Google''s use of the DART cookie enables it to serve ads to our site''s visitors based upon their visit to www.YourSite.com and other sites on the Internet.&nbsp<br />&amprarr Users may opt out of the use of the DART cookie by visiting the Google ad and content network privacy policy at the following URL -&nbsp<a title="Opt out of the Dart Cookie" href="http://www.google.com/privacy_ads.html">http://www.google.com/privacy_ads.html</a></p>\r\n<p><strong>Our Advertising Partners</strong></p>\r\n<p>Some of our advertising partners may use cookies and web beacons on our site. Our advertising partners include .......&nbsp</p>\r\n<p><em>While each of these advertising partners has their own Privacy Policy for their site, an updated and hyperlinked resource is maintained here:&nbsp<a href="http://www.privacypolicyonline.com/privacy-policies">Privacy Policies</a>.<br />You may consult this listing to find the privacy policy for each of the advertising partners of www.YourSite.com.</em></p>\r\n<p>These third-party ad servers or ad networks use technology in their respective advertisements and links that appear on www.YourSite.com and which are sent directly to your browser. They automatically receive your IP address when this occurs. Other technologies (such as cookies, JavaScript, or Web Beacons) may also be used by our site''s third-party ad networks to measure the effectiveness of their advertising campaigns and/or to personalize the advertising content that you see on the site.</p>\r\n<p>www.YourSite.com has no access to or control over these cookies that are used by third-party advertisers.</p>\r\n<p><strong>Third Party Privacy Policies</strong></p>\r\n<p>You should consult the respective privacy policies of these third-party ad servers for more detailed information on their practices as well as for instructions about how to opt-out of certain practices. www.YourSite.com''s privacy policy does not apply to, and we cannot control the activities of, such other advertisers or web sites. You may find a comprehensive listing of these privacy policies and their links here:<a title="Privacy Policy Links" href="http://www.privacypolicyonline.com/privacy-policy-links">Privacy Policy Links</a>.</p>\r\n<p>If you wish to disable cookies, you may do so through your individual browser options. More detailed information about cookie management with specific web browsers can be found at the browsers'' respective websites.&nbsp<a href="http://www.privacypolicyonline.com/what-are-cookies">What Are Cookies?</a></p>\r\n<p><strong>Children''s Information</strong><br />We believe it is important to provide added protection for children online. We encourage parents and guardians to spend time online with their children to observe, participate in and/or monitor and guide their online activity. www.YourSite.com does not knowingly collect any personally identifiable information from children under the age of 13. If a parent or guardian believes that www.YourSite.com has in its database the personally-identifiable information of a child under the age of 13, please contact us immediately (using the contact in the first paragraph) and we will use our best efforts to promptly remove such information from our records.</p>\r\n<p><strong>Online Privacy Policy Only</strong><br />This privacy policy applies only to our online activities and is valid for visitors to our website and regarding information shared and/or collected there. This policy does not apply to any information collected offline or via channels other than this website.</p>\r\n<p><strong>Consent</strong><br />By using our website, you hereby consent to our privacy policy and agree to its terms.</p>\r\n<p><a title="PrivacyPolicyOnline.com Approved Site" href="http://www.privacypolicyonline.com/" target="_blank"><img src="http://www.privacypolicyonline.com/images/privacypolicyonline-seal.png" alt="Privacy Policy Online Approved Site" align="right" border="0" /></a></p>\r\n<p><strong>Update</strong><br />This Privacy Policy was last updated on: Tuesday, January 12th, 2016.<br /><em>Should we update, amend or make any changes to our privacy policy, those changes will be posted here.</em></p>', 1, '2016-01-12 13:26:22', 1, '2016-01-12 13:51:19');
