(1356, 'en', 'This link allows you to download electronic business cards in vCard file format.<br />\r\nvCards are often attached to e-mail messages, but can also be placed on a web page. It contains name and address information, phone numbers and many more. This file created with simplified vCards for business use where only the most commonly properties are used.', 37, '2012-11-09 10:29:06', NULL, '0000-00-00 00:00:00'),
(1356, 'id', 'Link ini memungkinkan Anda untuk mengunduh kartu bisnis elektronik dalam format file vCard.<br />\r\nvCards sering dilampirkan pada email, tetapi juga dapat ditempatkan pada halaman web. vCard ini berisi informasi nama, alamat, nomor telepon, dan lain - lain. File ini dibuat dengan vCards yang disederhanakan untuk bisnis secara umum.', 37, '2012-11-09 10:29:06', NULL, '0000-00-00 00:00:00'),
(1357, 'en', 'You can download the vCard File directly here', 1, '2012-11-22 21:33:03', NULL, '0000-00-00 00:00:00'),
(1357, 'id', 'Anda dapat mengunduh file vCard tersebut disini', 1, '2012-11-22 21:33:03', NULL, '0000-00-00 00:00:00'),
(1358, 'en', 'This is your business card''s QR code. Use your cell phone to test if it can be scanned and whether it contains the data you intended to publish.', 37, '2012-11-09 10:30:03', NULL, '0000-00-00 00:00:00'),
(1358, 'id', 'Ini adalah QR Code kartu nama Anda. Gunakan ponsel Anda untuk menguji apakah dapat dipindai serta apakah informasi didalamnya berisi data yang Anda inginkan.', 37, '2012-11-09 10:30:03', NULL, '0000-00-00 00:00:00'),
(1359, 'en', 'The data you have filled in has generated a large QR Code image that might be very difficult to scan by most mobile devices, as of 2010.<br />\r\nIn order to generate a QR Code that''s easier to scan you have to reduce the size of the vCard file by at least 93 characters, either by reducing the size of some fields or by eliminating them altogether.', 37, '2012-11-09 10:30:30', NULL, '0000-00-00 00:00:00'),
(1359, 'id', 'Data yang telah Anda isikan telah dihasilkan ke dalam gambar QR Code berukuran besar, dimana kemungkinan ini akan sangat sulit untuk dipindai dengan kebanyakan perangkat mobile yang ada pada tahun 2010.<br />\r\nDalam rangka untuk menghasilkan QR Code yang lebih mudah dipindai, Anda harus mengurangi ukuran file vCard setidaknya sebanyak 93 karakter, baik dengan mengurangi panjang karakter dalam kolom form atau menghapus data tersebut sama sekali.', 37, '2012-11-09 10:30:30', NULL, '0000-00-00 00:00:00'),
